import "../Components/App.css";

function App() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col s12">Menu</div>
      </div>
      <div className="row">
        <div className="col s3">
          <PlayerList />
        </div>
        <div className="col s9">Menu</div>
      </div>
      <div className="row">
        <div className="col s12">Menu</div>
      </div>
    </div>
  );
}

export default App;
